#!/usr/bin/python

def get_starting_positions(pattern, genome):
    indexes = []
    pos = 0
    while pos < len(genome) - len(pattern):
        if genome[pos: pos + len(pattern)] == pattern:
            indexes.append(pos)
        pos += 1
    return indexes

def print_list(cust_list):
    for index in cust_list:
        print(index, end = ' ')

if __name__ == "__main__":
    pattern = 'AGAGGGTAG'
    genome = ''
    indexes = get_starting_positions(pattern, genome)
    print_list(indexes)


